export class AnticipoRmuComponent {
    constructor(sisgerhService, route, authService) {
        this.sisgerhService = sisgerhService;
        this.route = route;
        this.authService = authService;
        this.codigo = '';
        this.dtOptions = {};
        this.dtTrigger = new Subject();
    }
    ngOnInit() {
        this.dtOptions = {
            pagingType: 'full_numbers',
            pageLength: 10,
            info: true,
            processing: true,
            ordering: false,
            order: [],
            language: {
                "url": "//cdn.datatables.net/plug-ins/9dcbecd42ad/i18n/Spanish.json"
            },
            responsive: true,
            retrieve: true,
            "columnDefs": [
                {
                    "targets": [0],
                    "orderable": false
                }, {
                    targets: [1, 2, 7, 9, 10],
                    className: 'dt-body-left',
                }, {
                    targets: [4, 5, 6],
                    className: 'dt-body-right',
                }
            ]
        };
        this.verificarExistencia();
    }
    verificarExistencia() {
        this.inPer = this.authService.getCodPer();
        this.inPer = CryptoJS.AES.decrypt(this.inPer.toString(), 'eeasaPer').toString(CryptoJS.enc.Utf8);
